  'AdminAdvparametersHelp' => 
  array (
    'This page benefits from increased performance and includes new features such as a new combination management system.' => '该页面得益于性能的提高，并包括新的功能，如新的组合管理系统。',
    'Access the new product page, even in a multistore context. This is a work in progress and some features are not available.' => '即使在多商店环境中也能访问新产品页面。这是一项正在进行的工作，某些功能不可用。',
    'This page benefits from increased performance and includes new features such as a new combination management system. Please note this is a work in progress and some features are not available yet.' => '此页面受益于提高的性能，并包括新功能，例如新的组合管理系统。 请注意，这是一项正在进行的工作，某些功能尚不可用。',
    'or' => '或',
    'A category root is where a category tree can begin. This is used with multistore.' => '一个根分类表示一个分类树的开始，通常用在多商店功能。',
    '0 = Use quantity set in product, 1 = Use quantity from warehouse.' => '0=使用数量在商品设定，1=仓库使用数量。',
    'ID of the warehouse to set as storage.' => '仓库设置ID为存储。',
    'Use this option to associate data (products, modules, etc.) the same way for each selected shop.' => '使用此选项将数据以同样的方式为每个选定的商店联系起来 (产品，模块等)。',
    'Click here to display the shops in the %name% shop group' => '点击这里，显示%name%商店组里的商铺',
    'Click here to display the URLs of the %name% shop' => '点击这里来显示商铺%name%的URL',
    'Click here to display the list of shop groups' => '点击这里来显示商店群的列表',
    'Warning: Enabling the "share customers" and "share orders" options is not recommended. Once activated and orders are created, you will not be able to disable these options. If you need these options, we recommend using several categories rather than several shops.' => '警告：不建议启用“共享客户”和“共享订单”选项。一旦被激活并创建订单，您将无法禁用这些选项。如果您需要这些选项，我们建议启用几种类别，而不是几家商店。',
    'Once this option is enabled, the shops in this group will share customers. If a customer registers in any one of these shops, the account will automatically be available in the others shops of this group.' => '一旦启用此选项，此组中的商店将共享​​客户。如果客户在注册这些店铺的任何一个，则该帐户将自动出现在该组的其他商店。',
    'Warning: you will not be able to disable this option once you have registered customers.' => '警告：一旦您有注册客户您将无法禁用此选项。',
