    'Warning: You will not be able to disable this option once you\'ve started to accept orders.' => '警告：一旦您已经开始接受订单, 您将无法禁用此选项，。',
    'Enable or disable this shop group?' => '启用或禁用此店组？',
    'If you want to add a virtual URL, you need to activate URL rewriting on your web server and enable Friendly URL option.' => '如果你要添加一个虚拟URL，你需要在你的网站服务器上激活URL 重写功能并启用 Friendly URL 选项。',
    'You can use this option if you want to create a store with a URL that doesn\'t exist on your server (e.g. if you want your store to be available with the URL www.example.com/my-store/shoes/, you have to set shoes/ in this field, assuming that my-store/ is your Physical URL).' => '如果你要用一个在你的服务器上不存在的URL创建一个商店，你可以使用这个选项（例如，假设my-store/ 是你的物理URL，如果你希望你的商店通过 www.example.com/my-store/shoes/ 这个URL找到，你必须设置shoes/在此字段里。）。',
    'URL rewriting must be activated on your server to use this feature.' => '这个功能需要您的主机启用网址结​​构重写功能(URL Rewriting)',
