    'Warning: URL rewriting (e.g. mod_rewrite for Apache) seems to be disabled. If your Virtual URL doesn\'t work, please check with your hosting provider on how to activate URL rewriting.' => '警告：URL 重写（比如：Apache的mod_rewrite ）似乎被禁用。如果你的虚拟URL 无法正常工作，请和你的主机提供商联系看如何激活URL 重写功能。',
    'Ignore this field if you don\'t use the Multistore tool. If you leave this field empty, the default shop will be used.' => '如果没有使用多商店工具请忽略这个栏位，空白表示使用预设商店。',
    'Enable Advanced Stock Management on product (0 = No, 1 = Yes)' => '使产品高级库存管理（0=否，1=是）',
